import Navigation from '../components/Navigation';

const Home = () => {
    return (
      <div className='home'>
        <Navigation />
        <div className="home-content">
          <img src="./medias/code.jpg" alt="image-code" />
          <div className="home-content-text">
            <h4>Thomas Bressel</h4>
            <h3>Développeur Full-Stack</h3>
          </div>
      <div className="home-content-pdf">
        <span>Télécharger le CV</span>
      </div>

        </div>
        </div>
    );
};

export default Home;
